import React from 'react'
import {BrowserRouter, Route, Link} from 'react-router-dom'

const PageOne = () => {
    return (
        <div>
            PageOne</div>)
}

const PageTwo = () => {
    return (
        <div>PageTwo
            <button>Click me</button>
        </div>)
}

export default () => {
    return (
        <div>
            <BrowserRouter>
                <Route path="/"  component={PageOne}/>
                <Route path="/pagetwo" component={PageTwo} />
            </BrowserRouter>
        </div>
    )
}
